import './App.css';
import Page2 from './components/page2.jsx'
import Page3 from './components/page3.jsx'
import Nav from './components/Nav.jsx'
import AOS from 'aos';
import 'aos/dist/aos.css';

class App extends Component {
  componentDidMount(){
    AOS.init({
      duration : 1000
    })
  }
  render() {

  return (
    <div className="App" >
        <Nav data-aos='fade-down'/>
        <Page3/>
        <Page2/>
    </div>
  );
}
}

export default App;
